<script type="text/javascript">

document.getElementById('botonImprimirOp').addEventListener("click", imprimirOp)

function imprimirOp() {

      var doc = new jsPDF();

      var imgData = 'data:image/jpeg;base64,';

      doc.addImage(imgData,'JPEG',0,0,210,297);


      var nro_orden=$('.idorden').text();

      var ordenante=$('#usuario_altaop').val();

      var fecha_carga=$('#fecha_alta_op').val();

      //var fecha_carga = fecha_carga_larga.substring(0, fecha_carga_larga.length - 9);

      var receta=$('#nombre_receta_op').val();

      var peso_paston_largo=$('#pesopastonop').val();

      var peso_paston = peso_paston_largo.substring(0, peso_paston_largo.length - 5).replace('.',',');

      var peso_unidad_fresca_larga=$('#pesounidad_fresca').val();

      var peso_unidad_fresca = peso_unidad_fresca_larga.substring(0, peso_unidad_fresca_larga.length - 12).replace('.',',');

      var largo_unidad_fresca_larga=$('#largo_unidad_fresca').val();

      var largo_unidad_fresca = largo_unidad_fresca_larga.substring(0, largo_unidad_fresca_larga.length - 13).replace('.',',');

      var cantidad_unidades_frescas_larga=$('#cantidad_unidades_frescas').val();

      var cantidad_unidades_frescas = cantidad_unidades_frescas_larga.substring(0, cantidad_unidades_frescas_larga.length - 8).replace('.',',');

      var unidades_obtenidas_embutido_larga=$('#unidades_frescas_embutido').val();

      var unidades_obtenidas_embutido = unidades_obtenidas_embutido_larga.substring(0, unidades_obtenidas_embutido_larga.length - 8).replace('.',',');

      var peso_total_embutido_largo=$('#pesototalembutido').val();

      var peso_total_embutido = peso_total_embutido_largo.substring(0, peso_total_embutido_largo.length - 8).replace('.',',');

      var corte_largo=$('#corte').val();

      var corte=corte_largo.substring(0, corte_largo.length - 8).replace('.',',');

      var unidades_esperadas_largo=$('#unidades_esperadas').val();

      var unidades_esperadas=unidades_esperadas_largo.substring(0, unidades_esperadas_largo.length - 8).replace('.',',');

      var peso_esperado_largo=$('#peso_esperado').val();

      var peso_esperado=peso_esperado_largo.substring(0, peso_esperado_largo.length - 12).replace('.',',');

      var largo_esperado_largo=$('#largo_esperado').val();

      var largo_esperado=largo_esperado_largo.substring(0, largo_esperado_largo.length - 13).replace('.',',');

      var unidades_obtenidas_deposito_larga=$('#unidades_obtenidas_deposito').val();

      var unidades_obtenidas_deposito=unidades_obtenidas_deposito_larga.substring(0, unidades_obtenidas_deposito_larga.length - 8).replace('.',',');

      var fecha_finalizacion_deposito_larga=$('#fecha_finalizacion_deposito').val();

      var fecha_finalizacion_deposito=fecha_finalizacion_deposito_larga.substring(0, fecha_finalizacion_deposito_larga.length - 8).replace('.',',');

      var peso_total_deposito_largo=$('#pesototaldeposito').val();

      var peso_total_deposito=peso_total_deposito_largo.substring(0, peso_total_deposito_largo.length - 5).replace('.',',');

      var firma=$('#firma').val();

      doc.setTextColor('#F4F4F4').setFontStyle('bold').setFontSize(22).text(155,22,nro_orden);

      doc.setTextColor('#00000').setFontStyle('normal').setFontSize(10).text(47,30,ordenante);

      doc.setFontSize(10).text(157,30,fecha_carga);

      doc.setFontSize(10).text(47,45,receta);

      doc.setFontSize(10).text(150,45,peso_paston);

      doc.setFontSize(10).text(75,53,peso_unidad_fresca);

      doc.setFontSize(10).text(75,58,largo_unidad_fresca);

      doc.setFontSize(10).text(162,58,cantidad_unidades_frescas);

      doc.setFontSize(10).text(75,135,unidades_obtenidas_embutido);

      doc.setFontSize(10).text(162,135,peso_total_embutido);

      doc.setFontSize(10).text(44,195,corte);

      doc.setFontSize(10).text(75,202,unidades_esperadas);

      doc.setFontSize(10).text(162,195,peso_esperado);

      doc.setFontSize(10).text(162,202,largo_esperado);

      doc.setFontSize(10).text(70,217,unidades_obtenidas_deposito);

      doc.setFontSize(10).text(168,217,fecha_finalizacion_deposito);

      doc.setFontSize(10).text(55,225,peso_total_deposito);

      doc.setFontSize(10).text(162,225,firma);

  doc.save('testiamgen.pdf');
      
}

